Adding a new expression is actually pretty easy, as long as you don’t have to modify the type system. If it fits the parsing pattern of CompoundExpression, then you can just add it to the CompoundExpression registry, with a custom evaluation function. If not, well let’s see how to implement a “Foo” expression! Register the operator in definitions/index.js: const expressions: ExpressionRegistry = { ..., 'foo', FooExpression }; Create an implementation file at definitions/foo.js: export default class FooExpression implements Expression Implement static parse logic that’s used to create instances of the expression: static parse(args: Array<mixed>, context: ParsingContext) { // Here's where you enforce syntax -- if type checking fails, you pass // the error back up the chain with context.error if (args.length !== 2) return context.error(`'foo' expression requires exactly one argument.`); if (!isValue(args[1])) return context.error(`invalid value`); const child = (args[1]: any); return new FooExpression(child);
} Implement the evaluate method: evaluate(ctx: EvaluationContext) { // We don't use the context, but pass it through to our child return "bar" + this.child.evaluate(ctx);
} Implement the eachChild method — this is necessary for various algorithms that traverse the expression tree: eachChild(fn: (Expression) => void) { fn(this.child);
} Implement the possibleOutputs method — this is used to do a simple type of static analysis for expressions that have a finite number of possible outputs (for instance, if the top-level expression is a "``match``" expression with three literal outputs, the only possible outputs are those three, no matter what goes on in the sub-expressions. Some properties are required to have a defined set of possible outputs (for instance text-font), because we need to be able to fetch them ahead of evaluation time. If your expression depends on external state, it could very easily have an infinite number of potential outputs, in which case simply return [undefined]. possibleOutputs() { // Cop-out! return [undefined];
} Finally, implement the serialize method — this is basically the inverse of the parse method. The serialized result may not look identical to the original input that created an expression (because of changes like constant folding), but when evaluated it should give the same result (and in fact our test harness asserts that): serialize() { return ["foo", this.child.serialize()];
} You’re done! Although you should head straight over to test/integration/expression-tests, find an expression that’s similar to yours, copy its tests, and modify them to fit yours. An expression test has an: “expression”: of course “inputs”: array of Feature/GlobalProperties pairs “expected” “compiled”: type information “outputs”: evaluation results or errors “serialized”: result of round-tripping the expression through parse/serialize

