7.0.0 of the Maps SDK introduces the Style class. A Style object is a representation of the actively shown style on a map. Using the Style class provides more flexibility to create and adjust styles. The relationship between the map and the underlying style, becomes clearer with a dedicated Style too. A Style object must be created and given to the map for the map to appear properly. Create a Style by using a: default Mapbox style URL via the Style class custom map style URL from a Mapbox account JSON string Before 7.0.0, the map would default to the Mapbox Streets style if no style URL was given to the Maps SDK. Beginning with 7.0.0, there's no longer any defaulting to the Mapbox Streets style. If the style fails to load or an invalid style URL is set, the map will become blank. An error message will be logged in the Android logcat and the MapView.OnDidFailLoadingMapListener callback will be triggered. Here’s the setup for a Mapbox Streets map if Java 8 lambdas aren’t available: mapView.getMapAsync(new OnMapReadyCallback() { @Override public void onMapReady(MapboxMap mapboxMap) { mapboxMap.setStyle(Style.MAPBOX_STREETS, new Style.OnStyleLoaded() { @Override public void onStyleLoaded(@NonNull Style style) { // Map is set up and the style has loaded. Now you can add // data or make other map adjustments } }); }
}); Here’s the setup for a Mapbox Streets map if Java 8 lambdas are available: mapView.getMapAsync(mapboxMap -> mapboxMap.setStyle(Style.MAPBOX_STREETS, style -> { // Map is set up and the style has loaded. Now you can add data or make other map adjustments })
); Use the fromUri() method if you’d like to load a custom map style URL, rather than a default Mapbox style (e.g. Streets, Light, Satellite Streets, etc.): Using a URL: mapboxMap.setStyle(new Style.Builder().fromUri(UNIQUE_STYLE_URL)); Using JSON: mapboxMap.setStyle(new Style.Builder().fromJson(UNIQUE_STYLE_JSON)); Use a builder object to compose all components of a style. Style.Builder() provides additional style-related components such as sources, layers, images. Use the builder to configure the style transition options. mapboxMap.setStyle(new Style.Builder() .withLayer( new BackgroundLayer("bg") .withProperties(backgroundColor(rgb(120, 161, 226))) ) .withLayer( new SymbolLayer("symbols-layer", "symbols-source") .withProperties(iconImage("test-icon")) ) .withSource( new GeoJsonSource("symbols-source", testPoints) ) .withImage("test-icon", markerImage)
); Get the map’s Style to add a source or layer at a later point in your project: mapboxMap.getStyle().addLayer(layerObject); mapboxMap.getStyle().addSource(sourceObject);

